import React from "react";
import { 
    MDBCard,
    MDBCardBody,
    MDBContainer,
    MDBRow,
    MDBCol,
 } from "mdb-react-ui-kit";
 import "./style.css";
import { TableSection } from "./Components/tableSection";
export function Trello() {

    const trello = ["Dream", "Best", "Good", "Intermediate", "Evil"]



    return(
        <>  
            <div className="trello-container">
                <MDBRow className="trello-content">
                    {
                        trello.map((titles, i) => {

                            return (
                                <MDBCol key={i} >
                                    <TableSection tableTitle={titles}></TableSection>
                                </MDBCol>
                            )
                        })
                    }
                </MDBRow>
            </div>
        </>



    )
}
